import React from 'react';
import {Container} from 'react-bootstrap';

const Header = () => {
  return (
    <>
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="#home">
          <img
            alt=""
            src="/logo.svg"
            width="30"
            height="30"
            className="d-inline-block align-top"
          />{' '}
          urClass Posts
        </Navbar.Brand>
      </Navbar>
    </>
  );
}

export default Header;
